import React from 'react';
import category from '../../data/category.json';
import './Category.scss';

export const Category = () => (
  <div className="Category">
    <h1 className="Category-Title">Shop by category</h1>
    <ul className="Categoty-List">
    {category.map(item => (
      <li className="Category-Item" key={item}>
        <div className="Category-Image">
          <img
            className="category-image"
            src={item.image}
            alt="Image"
            // width="368px"
            // height="368px"
          />
        </div>
        <div>
          <h1 className="Category-ItemTitle">{item.title}</h1>
          <p className="Category-CountModel">100 models</p>
        </div>
      </li>
    ))}
    </ul>
    {category.map(item => (
      <li className="Category-Item" key={item}>
        <div className="Category-Image">
          <img
            className="category-image"
            src={item.image}
            alt="Image"
            // width="368px"
            // height="368px"
          />
        </div>
        <div>
          <h1 className="Category-ItemTitle">{item.title}</h1>
          <p className="Category-CountModel">100 models</p>
        </div>
      </li>
    ))}
  </div>
)
